import React from 'react';
import { Link } from 'react-router-dom';

import '../Styles/Header.css';
import Logo from '../Images/logo.png';

const Header = () => {
    return (
        <div className = 'header'>
            <div className = 'wrap'>
                <div className = 'brand'>
                    <h3>Code<span className = 'red'>_Fu</span></h3>
                    <img className = 'logo' src = { Logo } alt = 'logo' />
                </div>
                <h6>The Art and Disipline of Software Engineering</h6>
            </div>
            <nav className = 'links'>
                <ul>
                    <li><Link to = '/' className = 'link'>Home</Link></li>
                    <li><Link to = '/posts' className = 'link'>Blog Posts</Link></li>
                    <li><Link to = '/about' className = 'link'>About Me</Link></li>
                    <li><Link to = '/contact' className = 'link'>Contact Me</Link></li>
                </ul>
            </nav>
        </div>
    )
}

export default Header;
